import BoutiqueItem from "./components/BoutiqueItem"

//import { Link } from "react-router-dom";

class App extends Component {

  render() {
    return (
      <div>        
        <main className="container">
          <BoutiqueItem boutiqueItem/>
        </main>        
      </div>      
    );
  }
}

export default App;
